const GuardLandingPage =() =>
{
    return(
        <>
        <GuardDashboard/>
        <img src={imgPath} style={{ display: "block", margin: "auto", width: "50%", height: "50%", textAlign: "center", verticalAlign: "middle",marginTop:"60px" }} />

        </>
    )
}

export default GuardLandingPage;
